schemaDefinition: "create or replace view SN_SALESCREDITS(\n\t\"SCredOpportunitySysID\"\
  ,\n\t\"SCredLineBookDate\",\n\t\"SCredTypeName\",\n\t\"SCredAmountBase\",\n\t\"\
  SCredAmountUSD\",\n\t\"SCredCreditOrgName\",\n\t\"SCredCreditedMember\",\n\t\"SCredBusinessUnitName\"\
  ,\n\t\"SCredPartneredname\",\n\t\"SCredSourced\",\n\t\"SCredStatusCodename\",\n\t\
  \"SCredPercentageAllocation\",\n\t\"SCredTerritoryIDName\",\n\t\"SCredSalesCreditID\"\
  \n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"SN_OPPORTUNITY\" as \"SCredOpportunitySysID\"\
  ,\n       \"SN_LINEBOOKDATE\" as \"SCredLineBookDate\",\n       \"SN_SALESCREDITTYPENAME\"\
  \ as \"SCredTypeName\",\n       \"SN_AMOUNTUSD_BASE\" as \"SCredAmountBase\",\n\
  \       \"SN_AMOUNTUSD\" as \"SCredAmountUSD\",\n\t   \"SN_CREDITEDORGANIZATIONNAME\"\
  \ as \"SCredCreditOrgName\",\n\"SN_CREDITEDMEMBER\" as \"SCredCreditedMember\",\n\
  \"SN_BUSINESSUNITNAME\"  as \"SCredBusinessUnitName\",\n\"SN_PARTNEREDNAME\"  as\
  \ \"SCredPartneredname\",\n\"SN_SOURCED\"  as \"SCredSourced\",\n\"STATUSCODENAME\"\
  \  as \"SCredStatusCodename\",\n\"SN_PERCENTAGEALLOCATION\"  as \"SCredPercentageAllocation\"\
  ,\n\"SN_TERRITORYIDNAME\"  as \"SCredTerritoryIDName\",\n\"SN_SALESCREDITID\"  as\
  \ \"SCredSalesCreditID\"\nFROM \"RDS\".\"DYNAMICS365\".\"SN_SALESCREDITS\";"
